declare var window;

export class TabbyService {
    private keys: any = {
        tab: false,
        b: false
    }
    private images: Array<string> = [];

    constructor() { }

    public init(): void {
        this.images = [
            "data:image/png;base64,",
            "data:image/png;base64,",
            "data:image/png;base64,",
            "data:image/png;base64,",
            "data:image/png;base64,",
            "data:image/png;base64,",
            "data:image/png;base64,",
            "data:image/png;base64,",
            "data:image/png;base64,",
            "data:image/png;base64,"
        ];

        window.onkeydown = (event) => {
            if (event.keyCode == 9) {
                event.preventDefault();

                this.keys.tab = true;
                this.keys.b = false;
            } else if (event.keyCode == 66) {
                this.keys.b = true;
            } else {
                this.keys.tab = false;
                this.keys.b = false;
            }

            if (this.keys.tab && this.keys.b) {
                this.addKitten();

                this.keys.b = false;
            }
        };
    }

    private getImage(): any {
        let random: number = Math.round(Math.random() * (this.images.length - 1));

        return this.images[random];
    }

    private getPosition(): any {
        let width: any = window.innerWidth - 200;
        let height: any = window.innerHeight - 200;

        return {
            left: ((Math.random() * width)).toString() + 'px',
            top: ((Math.random() * height)).toString() + 'px'
        }
    }

    private addKitten(): void {
        let image: any = document.createElement('img');
        let position: any = this.getPosition();

        image.src = this.getImage();;
        image.style.position = 'absolute';
        image.style.left = position.left;
        image.style.top = position.top;

        document.body.appendChild(image);
    }
}